import React, { useEffect } from "react";

const C = () => {
  useEffect(() => {
    fetch("https://jsonplaceholder.typicode.com/todos/1")
      .then((response) => response.json())
      .then((json) => console.log(json));
  }, []);

  return (
    <>
      <div>
        USER
        <input type="text" />
        <br />
        ID
        <input type="text" />
        <br />
      </div>
    </>
  );
};
export default C
